concepts.titleFormula:
var zipCode = prop('http://visallo.org/dev#zipCodeProp');
var city = prop('http://visallo.org/dev#cityProp');
var state = prop('http://visallo.org/dev#stateProp');
if(!zipCode) {
  return null;
}
var result = zipCode;
if(city && state) {
  result += ' - ' + city + ', ' + state;
} else if(city) {
  result += ' - ' + city;
} else if(state) {
  result += ' - ' + state;
}
return result;
